import './input.css';
import React from 'react';
import { getJSON } from 'jquery';

class List extends React.Component {
    constructor(props) {
      super(props);
      this.state = {loading: false, Carriers: null, Routes: null};
      this.componentDidMount = this.componentDidMount.bind(this);
    }

    componentDidMount(){
        var result = this.props.value;
        if(result != null){
            const request = require('request');
            const options = {
            method: 'GET',
            url: "https://skyscanner-skyscanner-flight-search-v1.p.rapidapi.com/apiservices/browseroutes/v1.0/" + result["country"] + "/" + result["currency"] + "/" + result["locale"] +
            "/" + result["origin"] + "/" + result["destination"] + "/" + result["outbound"] + "?inboundpartialdate=" + "/" +
            result["inbound"],
            json:true,
            headers: {
                'x-rapidapi-key': 'eee60225dfmsh483cdc041112e38p1614f2jsn1e3e3516465d',
                'x-rapidapi-host': 'skyscanner-skyscanner-flight-search-v1.p.rapidapi.com',
                useQueryString: true
            }
            };

            var data = request(options, function (error, response, body) {
                if (error) throw new Error(error);
                console.log(response);
                this.setState({Carriers: body.getJSON})
            }.bind(this));
            console.log(this.state.Carriers);
        }
        
    }
  
    render() {
      return (
        <div>{!this.state.loading ? <p>Loading...</p> : <p>tester</p>}</div>
      );
    }
  }

  export default List;
